import UserActionTypes from "./user.types";

export const setCurrentUser = (user) => ({
  type: UserActionTypes.SET_CURRENT_USER,
  payload: user,
});
export const signInWithGoogleStart = () => ({
  type: UserActionTypes.SIGN_IN_WITH_GOOGLE_START,
});
export const signInWithGoogleSuccess = (user) => ({
  type: UserActionTypes.SIGN_IN_WITH_GOOGLE_SUCCESS,
  payload: user,
});
export const signInWithGoogleFailure = (error) => ({
  type: UserActionTypes.SIGN_IN_WITH_GOOGLE_FAILURE,
  payload: error,
});
export const signInWithEmailStart = (emailAndPassword) => ({
  type: UserActionTypes.SIGN_IN_WITH_EMAIL_START,
  payload: emailAndPassword,
});
export const signInWithEmailSucccess = (user) => ({
  type: UserActionTypes.SIGN_IN_WITH_EMAIL_SUCCESS,
  payload: user,
});
export const signInWithEmailFailure = (error) => ({
  type: UserActionTypes.SIGN_IN_WITH_EMAIL_FAILURE,
  payload: error,
});
